E_D("replace into `phome_ecms_game` values('5635','14','0','','','','1','admin','|26|','1','0','1343237057','0','0','0','0','','','5635','0','0','0','0','0','0','我爱妈妈的眼睛','1343237057','/spic/20120725/9511.jpg','0','1','1343237057','0','3','1','0','','0','','/d/file/swf/wodihaomama.swf','667','479','当我在病床上,从昏睡中醒来， <br />就会望见妈妈，那充满抚爱的眼睛。 <br />当我从学校里，捧回一张奖状， <br />就会望见妈妈，那充满欣慰的眼睛。 <br />啊,妈妈的眼睛，我心中温柔的灯， <br />我永远记着她的深情，妈妈的眼睛。 <br />当我和小伙伴， 在外面闯了祸， <br />就会想起妈妈， 那充满诚实的眼睛。 <br />当我在课堂上， 遇到一道难题， 就会想起妈妈， 那充满鼓励的眼睛。 妈妈的眼睛， 我心中明亮的灯， 我永远记着她的叮咛，她的眼睛。','1','','0','','1','/dpic/20120725/9512.jpg','2573','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhsTU0yUjJXa2RzYjFsWE9YUlpWekZvVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/zt/qinbao/2012/wodihaomama.swf','http://www.61baobao.com/zt/qinbao/2012/dpic/wodihaomama.jpg','http://www.61baobao.com/zt/qinbao/2012/pic/wodihaomama.jpg','0','三个月以上','0','','0','','0','0','0');");
