E_D("replace into `phome_ecms_game` values('5695','16','0','','','','1','admin','','1','0','1343237078','0','0','0','0','','','5695','0','0','0','0','0','0','我们多么幸福','1343237078','/spic/20120725/9635.jpg','0','1','1343237078','0','3','1','0','','0','','/d/file/swf/wodihaomama.swf','667','479','我们的生活多么幸福，我们的学习多么快乐<br />晨风吹拂五星红旗，彩霞染红万里山河<br />不论在城市还是乡村，家家的孩子都去上学<br />哈哈，我们的生活多么幸福<br />哈哈，我们的学习多么快乐<br />勇敢的海燕穿过白云，我们高高兴兴走进校门<br />今天我们跟着老师，学习科学学习本领<br />明天我们就像小鸟一样，飞向祖国工矿、农村<br />哈哈，我们的生活多么幸福<br />哈哈，我们的学习多么快乐<br />快乐的节日红旗招展，我们排着队伍昂首向前<br />工人叔叔农民阿姨，望见我们都露出笑脸<br />都说我们建设祖国，个个都是英雄模范<br />哈哈，我们的生活多么幸福<br />哈哈，我们的学习多么快乐<br />','1','','0','','1','/dpic/20120725/9636.jpg','2511','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhsTU0yUjJXa2RzYjFsWE9YUlpWekZvVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/zt/qinbao/2012/wodihaomama.swf','http://www.61baobao.com/zt/qinbao/2012/dpic/wodihaomama.jpg','http://www.61baobao.com/zt/qinbao/2012/pic/wodihaomama.jpg','0','三个月以上','0','','0','','0','0','0');");
