E_D("replace into `phome_ecms_game` values('5816','14','0','','','','1','admin','|8|','1','0','1343237122','0','0','0','1','','','5816','0','0','0','0','0','0','红星歌','1343237122','/spic/20120725/10044.jpg','0','1','1343609839','0','3','1','0','','1','','/d/file/swf/hongxing.swf','667','479','词曲/傅庚辰<br /><br />    红星闪闪放光彩，红星灿灿暖胸怀，红星是咱工农的心，党的光辉照万代。红星是咱工农的心，党的光辉照万代。长夜里，红星闪闪驱黑暗；寒冬里，红星闪闪迎春来；斗争中，红星闪闪指方向；征途上，红星闪闪把路开。红星闪闪放光彩，红星灿灿暖胸怀，跟着毛主席跟着党，闪闪的红星传万代，跟着毛主席跟着党，闪闪的红星传万代。<br /><br />    1974年电影《闪闪的红星》热映，一曲《红星闪闪》打动了千千万万儿童的心。他们穿着红军服，抗着红缨枪，雄壮有力地走在大路上，胸中溢满了自豪和勇敢。歌曲唱出了小红军战士对“红星”的深情和对革命的无限忠诚。集中代表了红军后代跟着党永远干革命的坚定信念，以及对象征党的“红星”的热情赞颂。','1','','0','','1','/dpic/20120725/10045.jpg','2349','VEROd01Fd3pSbkJpYlVwb1luazViMkl5Tlc1bFIyeDFXbmsxZW1ReVdUMD0=','0','0','http://s.61baobao.com/zt/qinbao/hongxing.swf','http://www.61baobao.com/common/flash/2009/dpic/hongxing.jpg','http://www.61baobao.com/common/flash/2009/pic/2349.jpg','0','三个月以上','0','','0','','0','0','0');");
