E_D("replace into `phome_ecms_game` values('5893','14','0','','','','1','admin','|26|61|','1','0','1343237149','0','0','0','0','','','5893','0','0','0','0','0','0','做个小孩不容易','1343237149','/spic/20120725/10158.jpg','0','1','1343237149','0','3','1','0','','0','','/d/file/swf/genwozuo.swf','667','479','大人总是羡慕我们无忧无虑，大人总是以为我们快乐无比。<br />其实他们不知道哇不知道，做个小孩可真是不容易！<br />在家里，我是受气的小皇帝。<br />妈妈也讲，爸爸也讲， 全都是做人的大道理。<br />在学校，老师是那么的严厉。<br />要好成绩，要好纪律，多少做不完的练习题！<br />哎哟哟，哎哟哟，做个小孩唉！真是不容易！<br />大人总是羡慕我们无忧无虑，大人总是以为我们快乐无比。<br />其实他们不知道哇不知道，做个小孩可真是不容易！<br />眼巴巴，盼来一个星期天。<br />练琴学画，补习英语，偏 偏就不能把足球踢！<br />走在街上，总算找到了我自己，<br />想跳就跳，随心所欲，行人却说我多动太淘气！<br />哎哟哟，哎哟哟，做个小孩唉！<br />真是不容易！真是不容易！唉！','1','','0','','1','/dpic/20120725/10159.png','2277','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREprYkdKdVpIWmxibFoyVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2006/genwozuo.swf','http://www.61baobao.com/images/2012/default_infopic.png','http://www.61baobao.com/common/flash/2006/pic/240.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('5894','14','0','','','','1','admin','|61|','1','0','1343237150','0','0','0','0','','','5894','0','0','0','0','0','0','爱护小树苗','1343237150','/spic/20120725/10398.jpg','0','1','1343237150','0','3','1','0','','0','','/d/file/swf/2283.swf','667','479','儿歌,中文儿歌,flash儿歌,儿童最爱,配动画，经典儿歌，儿童歌曲','1','','0','','1','/dpic/20120725/10399.jpg','2283','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRTFUSHBKZVU5RVRYVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2009/2283.swf','http://www.61baobao.com/common/flash/2009/dpic/2283.jpg','http://www.61baobao.com/common/flash/2009/pic/2283.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('5895','14','0','','','','1','admin','|61|','1','0','1343237150','0','0','0','0','','','5895','0','0','0','0','0','0','猪都笑了儿童版','1343237150','/spic/20120725/10176.jpg','0','1','1343237150','0','3','1','0','','0','','/d/file/swf/2268.swf','667','479','小青蛙说它嘴巴大， 河马叔叔就笑了；<br />河马叔叔说它个子大， 大象爷爷就笑了；<br />大象爷爷说它啥都不怕， 老鼠弟弟就笑了；（咬你耳朵）<br />老鼠说它爱大米， 母鸡阿姨就笑了。（咯咯咯咯）<br /><br /><br />母鸡阿姨说它会唱歌， 鹦鹉哥哥就笑了；<br />鹦鹉哥哥说它眼睛大， 小燕子姐姐就笑了；(我是还珠格格)<br />小燕子说它最可爱， 小狗狗就笑了；<br />小狗狗说它最聪明， 大猩猩就笑了。<br /><br />啦。。。。。。。。 米奇老鼠唐老鸭，<br />大猩猩说它是人模样， 胖呼呼的猪都笑了。<br /><br /><br />天鹅姑姑说它最美丽， 孔雀姐姐就笑了；<br />孔雀姐姐说它很骄傲， 小白兔就笑了；<br />小白兔说它跑得快， 老乌龟就笑了（龟兔赛跑）<br />老乌龟说它是国宝啊， 大熊猫就笑了。<br /><br />啦。。。。。。。。 团团又圆圆，<br />大熊猫说它去台湾啊， 全国人民都笑了。<br /><br />','1','','0','','1','/dpic/20120725/10177.jpg','2268','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRTFUSHBKZVU1cVozVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2009/2268.swf','http://www.61baobao.com/common/flash/2009/dpic/2268.jpg','http://www.61baobao.com/common/flash/2009/pic/2268.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('5896','14','0','','','','1','admin','|61|','1','0','1343237150','0','0','0','0','','','5896','0','0','0','0','0','0','自作聪明的小毛驴','1343237150','/spic/20120725/10164.jpg','0','1','1343237150','0','3','1','0','','0','','/d/file/swf/05.swf','667','479','小小毛驴儿不抬头<br />驮着盐巴往前走<br />路程远盐巴重<br />走到桥上腿发抖<br />扑通摔下河<br />盐巴顺水流<br />扑通摔下河<br />盐巴顺水流<br />爬上岸多轻松<br />毛驴儿心中乐悠悠<br /><br />小小毛驴儿抬起头<br />驮着棉花往回走<br />一面走一面看<br />走到桥上想计谋<br />扑通跳下河<br />棉花全湿透<br />扑通跳下河<br />棉花全湿透<br />爬上岸更加重<br />自作聪明吃苦头<br />','1','','0','','1','/dpic/20120725/10165.jpg','2276','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhoTWVrRXhURzVPTTFwblBUMD0=','0','0','http://s.61baobao.com/zt/qinbao/2011/05.swf','http://www.61baobao.com/zt/qinbao/2011/dpic/05.jpg','http://www.61baobao.com/zt/qinbao/2011/pic/05.jpg','0','三个月以上','0','','0','','0','0','0');");
